import React from 'react';
import './App.css';
import TodosCmp from './components/Todos'
import {Todo} from './blueprints/todo'


function App() {
  const todos = [
    new Todo('Learn React'),
    new Todo('Learn Typescript')
  ]


  return (
    <div>
      <TodosCmp items={todos} />
    </div>
  );
}

export default App;
